import React from 'react';
import PostSummary from './postSummary';

const PostsList = () => {
    return (
        <div className="post-list section">
            <PostSummary />
            <PostSummary />
            <PostSummary />
            <PostSummary />
        </div>
    )
}

export default PostsList;
